const Landing = () => {
  return (
    <>
      <section className="landing-logo">
        <img src="./images/main-logo.svg" alt=""></img>
        <button className="landing-button">GET STARTED</button>
        <p className="landing-text">LOGIN</p>
      </section>
    </>
  );
};

export default Landing;
